-- Connect to database
CREATE DATABASE bus_data;
\connect bus_data;

-- Add postgis extensions
CREATE EXTENSION postgis;
CREATE EXTENSION postgis_topology;

-- Create the temp table
CREATE TABLE public.my_table (
    c1 REAL,
    c2 REAL,
    c3 INTEGER,
    c4 INTEGER,
    c5 INTEGER,
    c6 REAL,
    c7 REAL
);

-- Create the final data table
CREATE TABLE public.stops (
    stop_id INTEGER PRIMARY KEY NOT NULL,
    coords GEOMETRY,
    brd_count INTEGER,
    ali_count INTEGER,
    lat_long GEOMETRY
);

-- Index coords
CREATE INDEX stop_coord_index ON stops USING GIST(coords);

